const ItemCart = ({item}) => {
    return (
        <div>
            <table class="table table-dark">
                <thead>
                    <tr>
                    <th scope="col">#</th>
                    </tr>
                </thead>
            </table>
            {/* Producto:{item.name} Cantidad pedida:{item.amount} Precio:${item.price} */}
        </div>
    );
}

export default ItemCart;
